import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './Form.css';


class SignUpForm extends Component {
    render() {
        return (
            <div className="FormCenter">
              <form className="FormFields" onSubmit={this.handleSubmit}>
                <div className="FormField">
                  <label className="FormField__Label" htmlFor="name">Full Name</label>
                  <input type="text" id="name" className="FormField__Input" placeholder="Enter your full name" name="name"/>
                </div>

                <div className="FormField">
                  <label className="FormField__Label" htmlFor="email">E-mail address</label>
                  <input type="text" id="name" className="FormField__Input" placeholder="Enter your email address" name="email"/>
                </div>

                <div className="FormField">
                  <label className="FormField__Label" htmlFor="password">Password</label>
                  <input type="text" id="name" className="FormField__Input" placeholder="Enter your password" name="password"/>
                </div>
                <div className="FormField">
                  <label className="FormField__CheckBoxLabel">
                    <input type="checkbox" className="FormField__Checkbox" name="has agreed"/> I agree all statements in <a href="" className="FormField_TermsLink"> terms of service</a>
                  </label>
                </div>
                <div className="FormField">
                  <button className="FormField__Button mr-20">Sign Up</button><Link to="/sign-in" className="FormField__Link">I'm already a member</Link>
                </div>
              </form>
            </div>
        );
    }

}

export default SignUpForm;
